import { React ,useEffect,useState} from 'react';
import axios from 'axios';
const Home = () => {
    const [Posts , setPosts] = useState([]);
    const apiEnd = 'https://jsonplaceholder.typicode.com/posts';

    useEffect(()=>{
        const getPosts = async () =>{
            const { data : res} =  await axios.get(apiEnd)
            setPosts(res)
        };
        getPosts();
    },[])
    return (

        <div className='container'>
            <h2>there are {Posts.length}post in the database</h2>
            <button  className='btn btn-primary '  >Add Post</button>    
            <table className='table'>
              <thead>
                 <tr>
                   <th>Title</th>
                   <th>Update</th>
                   <th>Delete</th>
                 </tr>
                 <tbody>
                  {Posts.map((Post) => (
                      <tr key={Post.id}>
                          <td> {Post.title} </td>
                            <td> <button className='btn  btn-info me-5 btn-sm'>Update</button></td> 
                            <td> <button className='btn  btn-danger btn-sm '>Delete</button></td>    
                      </tr>
                  ))}
                 </tbody>
              </thead>
          </table>
        </div>
    );
}

export default Home;
